import React from 'react';
import { Block } from './Block';
import './index.scss';

function App() {

	const [rates, setRates] = React.useState([]);

	React.useEffect(() => {
		fetch('currencies.json').then((res) => res.json()).then((json) => {
			setRates(json.rates);
			console.log(json.rates);
		}).catch((err) => {
			console.warn(err);
			alert('Could not fetch json file');
		})
	}, []);

	return (
		<div className="App">
			<Block value={0} currency="RUB" onChangeCurrency={(cur) => console.log(cur)} />
			<Block value={0} currency="USD" />
		</div>
	);
}

export default App;
